    false,nt"url": null,nt"notes": "This annual narrative report for Crosby
    Waterfowl Production Area Management Office outlines Refuge accomplishments during
    the 1971 calendar year. The report begins by giving a description of the area and
    summarizing the status of the acquisition program. Weather conditions, habitat conditions,
    water conditions, and food and cover conditions during the year are covered. Wildlife-
    including migratory birds, water and marsh birds, shorebirds, upland game birds,
    big game animals, furbearers, predators, rodents, rare and endangered species, fish,
    and reptiles and amphibians- is also covered. The Refuge development and maintenance
    section discusses physical developments, plantings, cultivated crops,  collections
    and receipts, disposal of improvements, and vegetation control. Resource management
    is outlined; topics include grazing and fur harvesting. A progress report on field
    investigations and applied research is also provided. The public relations section
    of the report describes recreational uses, Refuge participation, violations, Refuge
    visitors, revenue sharing, and safety. Problems, items of interest, N-R forms, and
    newspaper articles are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
